import React from 'react';

class GameList extends React.Component{
    render(){
        return(
            <div>
                <div>
                    <div>New Games</div>
                    <div>More</div>
                </div>
                <div>
                    <div>img</div>
                    <div>
                        <div>Geme Name</div>
                        <div>LV</div>
                        <div>简介</div>
                    </div>
                    <div>ico</div>
                </div>
            </div>
        )
    }
}

export default GameList;
